Sitting in an exit row seat comes with important responsibilities. You may be required to assist our crew if there is an emergency. For this reason, the following conditions will restrict you from seating in an exit row seat:

1. Physical condition which may prevent a customer from assisting crew during an emergency;
2. Customers of large body frame and/or big built who may require an extension seat belt;
3. Lack of strength, mobility, dexterity, or balance required to open the exit;
4. Inability to quickly reach the exit, open it and evacuate the aircraft;
5. Hearing or visual impairment;
6. Not being able to understand and carry out instructions;
7. Have other responsibilities that would prevent you from assisting crew during an emergency (such as small children to care for);
8. Aged less than 15 years;
9. Pregnancy;
10. In the event of an emergency be able to reach, open, lift and throw out an exit door that weighs up to 30 kg 
Fiji Airways has the sole discretion, at check-in or boarding, to determine if a customer meets the requirements to sit in an exit row seat. A customer that does not meet these important requirements will be assigned to a different seat.
